  false,\n\t\"url\": null,\n\t\"notes\": \"On June 8, 1993, a tour on habitat evaluation
  of management practices at Browns Park NWR took place.The overall objective of the
  tour was to conduct a habitat evaluation of the Refuge, especially the riparian
  and wetland ecosystems. Specific objectives for the Refuge included the following:
  1) Evaluate the current health ( e.g., condition) of the riparian and wetland ecosystems.
  2) Recommend changes in current management practices, if necessary. 3) Discuss the
  natural dynamics associated with a river ecosystem. 4) Discuss the ecology of the
  major riparian and wetland vegetation types found on the Refuge. 5) Discuss management
  opportunities for the major riparian or wetland vegetation types found on the Refuge.\",\n\t\"owner_org\":
